  function getPricePerFullShare() public view returns (uint) {
    uint _pool = calcPoolValueInToken();
    return _pool.mul(1e18).div(_totalSupply);
  }
}

function deposit(uint256 _amount)
    external
    nonReentrant
{
    require(_amount > 0, "deposit must be greater than 0");
    pool = _calcPoolValueInToken();

    IERC20(token).safeTransferFrom(msg.sender, address(this), _amount);

    // Calculate pool shares
    uint256 shares = 0;
    if (pool == 0) {
      shares = _amount;
      pool = _amount;
    } else {
      shares = (_amount.mul(_totalSupply)).div(pool);
    }
    pool = _calcPoolValueInToken();
    _mint(msg.sender, shares);
}

// No rebalance implementation for lower fees and faster swaps

function withdraw(uint256 _shares)
    external
    nonReentrant
{
    require(_shares > 0, "withdraw must be greater than 0");

    uint256 ibalance = balanceOf(msg.sender);
    require(_shares <= ibalance, "insufficient balance");

    // Could have over value from cTokens
    pool = _calcPoolValueInToken();
    // Calc to redeem before updating balances
    uint256 r = (pool.mul(_shares)).div(_totalSupply);


    _balances[msg.sender] = _balances[msg.sender].sub(_shares, "redeem amount exceeds balance");
    _totalSupply = _totalSupply.sub(_shares);

    emit Transfer(msg.sender, address(0), _shares);

    // Check balance
    uint256 b = IERC20(token).balanceOf(address(this));
    if (b < r) {
      _withdrawSome(r.sub(b));
    }

    IERC20(token).safeTransfer(msg.sender, r);
    pool = _calcPoolValueInToken();
}

function recommend(address _token) public view returns (
  string memory choice,
  uint256 capr,
  uint256 iapr,
  uint256 aapr,
  uint256 dapr
) {
  ( , capr, , iapr, , aapr, , dapr, , ) = getAPROptionsInc(_token);
  return (choice, capr, iapr, aapr, dapr);
}

function getUserBorrowBalances(address _reserve, address _user)
    public
    view
    returns (uint256, uint256, uint256)
{
    CoreLibrary.UserReserveData storage user = usersReserveData[_user][_reserve];
    if (user.principalBorrowBalance == 0) {
        return (0, 0, 0);
    }

    uint256 principal = user.principalBorrowBalance;
    uint256 compoundedBalance = CoreLibrary.getCompoundedBorrowBalance(
        user,
        reserves[_reserve]
    );
    return (principal, compoundedBalance, compoundedBalance.sub(principal));
}

